        textAlign: "center",
        fontFamily: "Poppins, sans-serif",
        paddingTop: "60px",
      }}
    >
      {/* Logo + Title */}
      <h1 style={{ fontSize: "2.5rem", fontWeight: "700", letterSpacing: "1px" }}>
        ðŸŽ¯ TARGET MARKETING ACADEMY
      </h1>

      {/* Subtitle */}
      <p style={{ color: "#fff", fontSize: "1.1rem", marginTop: "10px" }}>
        Innovation. Intelligence. Impact.
      </p>

      {/* Description */}
      <p
        style={{
          color: "#ccc",
          maxWidth: "700px",
          margin: "20px auto",
