      >
        A next-generation educational ecosystem merging <span style={{ color: "#FFD700" }}>marketing</span>,{" "}
        <span style={{ color: "#FFD700" }}>trading</span>, and{" "}
        <span style={{ color: "#FFD700" }}>AI</span> under one visionary platform â€” GPS Systems.
      </p>

      {/* Navigation Buttons */}
      <div
        style={{
          display: "flex",
          justifyContent: "center",
          flexWrap: "wrap",
          gap: "15px",
          marginTop: "40px",
        }}
      >
        {[
          "GPS TRADING",
          "GPS MARKETING",
          "GPS DROPSHIPPING",
          "GPS LANGUAGES",
          "GPS STUDIO",
        ].map((item) => (
          <button
            key={item}
            style={{
              backgroundColor: "#FFD700",
              color: "#000",
              border: "none",
              borderRadius: "8px",
              padding: "12px 20px",
              fontWeight: "600",
              cursor: "pointer",
              transition: "0.3s",
            }}
